import React, { useState } from 'react';
// import Button from '@mui/material/Button';
// import TextField from '@mui/material/TextField';
import '../Login/Login.scss';

function Login() {
  // const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
  };

  return (
    <>
     <div className="container">
            <h1 className="title">Fundo</h1>
            <h2 className="subtitle">Sign in</h2>
            <p className="description">Use your Fundo Account</p>
            <form onSubmit={handleSubmit} className="form">
                <input 
                    type="text" 
                    placeholder="Email or phone*" 
                    // value={email} 
                    // onChange={(e) => setEmail(e.target.value)} 
                    className="input" 
                    required 
                />
                <input 
                    type="password" 
                    placeholder="Password*" 
                    // value={password} 
                    onChange={(e) => setPassword(e.target.value)} 
                    className="input" 
                    required 
                />
                <button type="submit" className="button">Login</button>
                <div className="links">
                {/* eslint-disable-next-line jsx-a11y/anchor-is-valid */}
                    <a href="#" className="link">Forgot password</a>
                    <span className="link"> | </span>
                {/* eslint-disable-next-line jsx-a11y/anchor-is-valid */}
                    <a href="#" className="link">Create account</a>
                </div>
            </form>
            <div className="footer">
                <select className="select">
                    <option>English (United States)</option>
                    {/* Add more languages as needed */}
                </select>
                <span className="link">Help</span>
                <span className="link">Privacy</span>
                <span className="link">Terms</span>
            </div>
        </div>
    </>
  );
}

export default Login;
